import React , {useState} from 'react'
import { connect } from 'react-redux'
import { Link, Redirect } from 'react-router-dom'
import { empcreate } from '../Actions/Auth'


function AddEmp({empcreate,isAuthenticated}) {

    const [empcreated, setempcreated] = useState(false)

    const [Formdata, setFormdata] = useState({
        name : '',
        first_dose : '',
        second_dose : '',
        both: '',
        not_both: '',
        domain : ''
    });

    const { name , first_dose , second_dose , both , not_both , domain } = Formdata;

    const onChange = e => setFormdata({...Formdata,[e.target.name]:e.target.value})

    const onSubmit = e => {
        e.preventDefault();
        empcreate(name,first_dose,second_dose,both,not_both,domain)
        setempcreated(true);
    }

    if(empcreated) {
        return <Redirect to='/emp' />
    }

    return (
        <div className='container mt-5'>
            <h1>Register your domain</h1>
            <p>Create your Account</p>
            <form onSubmit={e => onSubmit(e)}>


                <div className='form-group'>
                    <input
                        className='form-control'
                        type='email'
                        placeholder='Email*'
                        name='email'
                        value={email}
                        onChange={e => onChange(e)}
                        required
                    />
                </div>
                <br/>

                <div className='form-group '>
                    <input
                        className='form-control'
                        type='text'
                        placeholder='domain name*'
                        name='domain'
                        value={domain}
                        onChange={e => onChange(e)}
                        required
                    />
                </div>
                <br/>
                <div className='form-group'>
                    <input
                        className='form-control'
                        type='password'
                        placeholder='Password*'
                        name='password'
                        value={password}
                        onChange={e => onChange(e)}
                        minLength='6'
                        required
                    />
                </div>
                <br/>

                <button className='btn btn-primary' type='submit'>Register</button>

            </form>

            <p className='mt-3'>
                Already have an account? <Link to='/'>Sign In</Link>
            </p>
        </div>
    )
}


const mapStateToProps = state => ({
    isAuthenticated
})
export default AddEmp
